actionConfiguration.body:
() => {
  let state = 1;
  if (Select_GTPillar.selectedOptionValue.length === 0) {
    showAlert('请选择一个尾翼支撑架样式');
    state = 0;
  }
  if (Select_GTPillarMaterial.selectedOptionValue.length === 0) {
    showAlert('请选择一个尾翼支撑架颜色');
    state = 0;
  }
  if (Select_GTMainWing.selectedOptionValue.length === 0) {
    showAlert('请选择一个主尾翼板样式');
    state = 0;
  }
  if (Select_GTMainWingColor.selectedOptionValue.length === 0) {
    showAlert('请选择一个主尾翼板颜色');
    state = 0;
  }
  if (Select_GTWingTip.selectedOptionValue.length === 0) {
    showAlert('请选择一个主尾翼侧面板样式');
    state = 0;
  }
  if (Select_Material.selectedOptionValue.length === 0) {
    showAlert('请选择一个主尾翼板材质');
    state = 0;
  }
  if (state === 0) {
    showAlert('安装/更新失败，请确保所有选项都有选项选中');
  } else if (state === 1) {
    Install_GT.run();
    Select_GTDetails.run();
    Select_Car_Tune_NoDe.run();
    showAlert('安装/更新自定义GT翼成功');
  }
}

